import React, { Component } from 'react'
import './style.css'

export default class Navigation extends Component {
    render() {
        return (
            <div className='menu-container'>
                <span className='page-name'>Explore</span>

                <div className='links-container'>
                    <span>Photos</span>
                    <span>Add new photo</span>
                </div>
            </div>
        )
    }
}
